import React from "react";
import {Component} from "react";
import axios from "axios";
import {SwapiItem} from "./SwapiItem";


export class SwapiClass extends React.Component {

    componentDidMount() {
        axios.get("https://swapi.dev/api/people")
            .then(result => this.props.setSwapi(result.data.results));
    }

    render() {
        return (
            <div>
                <button>
                    SHOW
                </button>
                <div>{
                    this.props.usersData.map((swapi) => <SwapiItem name={swapi.name} height={swapi.height} mass={swapi.mass}/>)
                }
                </div>
            </div>
        )
    }
}
